  `categoria` varchar(100) NOT NULL,
  `numero` varchar(10) NOT NULL,
  `descricao` varchar(255) NOT NULL,
  `umidade` int(11) DEFAULT NULL,
  `kcal` int(11) DEFAULT NULL,
  `kj` int(11) DEFAULT NULL,
  `proteina` float DEFAULT NULL,
  `lipideos` float DEFAULT NULL,
  `colesterol` float DEFAULT NULL,
  `carboidrato` float DEFAULT NULL,
  `fibra_alimentar` float DEFAULT NULL,
  `cinzas` float DEFAULT NULL,
  `calcio` float DEFAULT NULL,
  `magnesio` float DEFAULT NULL,
  `manganes` float DEFAULT NULL,
  `fosforo` float DEFAULT NULL,
  `ferro` float DEFAULT NULL,
  `sodio` float DEFAULT NULL,
  `potassio` float DEFAULT NULL,
  `cobre` float DEFAULT NULL,
  `zinco` float DEFAULT NULL,
  `retinol` float DEFAULT NULL,
  `re` float DEFAULT NULL,
  `rae` float DEFAULT NULL,
  `tiamina` float DEFAULT NULL,
  `riboflavina` float DEFAULT NULL,
  `piridoxina` float DEFAULT NULL,
  `niacina` float DEFAULT NULL,
  `vitamina_c` float DEFAULT NULL,
  `created_at` date DEFAULT NULL,
  `updated_at` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=598 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;

